<template><div><p>这份合约是一个基于Solidity语言编写的智能合约，用于实现一个流动性挖矿平台，主要功能包括用户存入流动性、获取收益、以及管理产品等。以下是对合约的规范说明文档，旨在阐述其功能逻辑：</p>
<h3 id="合约名称-lpfarm" tabindex="-1"><a class="header-anchor" href="#合约名称-lpfarm"><span>合约名称：LPFarm</span></a></h3>
<h4 id="合约功能" tabindex="-1"><a class="header-anchor" href="#合约功能"><span>合约功能：</span></a></h4>
<ul>
<li>用户可以存入基金池质押 ETH 获得的 YT（ERC20 Token）来参与挖矿，并获得奖励。</li>
<li>用户可以存入多个订单，每个质押订单单独计算。</li>
<li>用户订单到期之后，收益继续产出，直到主动撤出质押资产。</li>
</ul>
<h4 id="主要变量" tabindex="-1"><a class="header-anchor" href="#主要变量"><span>主要变量：</span></a></h4>
<ul>
<li><code v-pre>TOKEN</code>: 收益产出代币地址。</li>
<li><code v-pre>lpToken</code>: LP Token的合约地址。</li>
<li><code v-pre>tokenPerBlock</code>: 每块平均产出的代币数量。</li>
<li><code v-pre>proTotal</code>: 产品总数。</li>
<li><code v-pre>startBlock</code>: 开始挖矿的区块。</li>
<li><code v-pre>lastRewardBlock</code>: 奖励最后更新的区块。</li>
<li><code v-pre>accTokenPerShare</code>: 每股累计的代币奖励。</li>
<li><code v-pre>accDividendPerShare</code>: 每股累计的分红奖励。</li>
<li><code v-pre>totalPower</code>: 总算力。</li>
<li><code v-pre>totalDividend</code>: 累计分红资金。</li>
</ul>
<h4 id="结构体" tabindex="-1"><a class="header-anchor" href="#结构体"><span>结构体：</span></a></h4>
<ul>
<li><code v-pre>Product</code>: 定义产品周期时间和乘数。</li>
<li><code v-pre>Order</code>: 定义订单的ID、参与金额、订单算力和订单时间。</li>
<li><code v-pre>UserInfo</code>: 定义用户的算力、质押量、已获取奖励、待领取奖励、奖励债务等信息。</li>
</ul>
<h4 id="事件" tabindex="-1"><a class="header-anchor" href="#事件"><span>事件：</span></a></h4>
<ul>
<li><code v-pre>Deposit</code>: 用户存入流动性时触发。</li>
<li><code v-pre>Withdraw</code>: 用户提取收益时触发。</li>
</ul>
<h4 id="函数" tabindex="-1"><a class="header-anchor" href="#函数"><span>函数：</span></a></h4>
<ol>
<li><strong>初始化函数</strong> (<code v-pre>initialize</code>): 初始化合约的基本参数。</li>
<li><strong>获取奖励代币地址</strong> (<code v-pre>getToken</code>): 返回奖励代币的地址。</li>
<li><strong>获取挖矿代币地址</strong> (<code v-pre>getLpToken</code>): 返回挖矿代币的地址。</li>
<li><strong>获取用户信息</strong> (<code v-pre>getUserInfo</code>): 返回指定用户的详细信息。</li>
<li><strong>获取加权奖励倍数</strong> (<code v-pre>getMultiplier</code>): 根据区块范围计算奖励倍数。</li>
<li><strong>查看pending的token奖励</strong> (<code v-pre>pendingToken</code>): 查看用户待领取的奖励。</li>
<li><strong>更新池子奖励变量</strong> (<code v-pre>updatePool</code>): 更新总算力和每股累计奖励。</li>
<li><strong>存入LP Token</strong> (<code v-pre>deposit</code>): 用户存入LP Token参与挖矿。</li>
<li><strong>领取收益</strong> (<code v-pre>withdraw</code> 和 <code v-pre>_withdraw</code>): 用户领取收益。</li>
<li><strong>领取本金</strong> (<code v-pre>harvestOrderPrincipal</code>): 用户领取自己的本金。</li>
<li><strong>安全转移TOKEN</strong> (<code v-pre>safeTokenTransfer</code>): 安全地将代币转移到用户地址。</li>
<li><strong>设置出块奖励</strong> (<code v-pre>setTokenPerBlock</code>): 管理员设置每块的奖励代币数量。</li>
<li><strong>新增产品</strong> (<code v-pre>addPro</code>): 管理员新增挖矿产品。</li>
<li><strong>获取所有产品信息</strong> (<code v-pre>getAllProducts</code>): 获取系统中所有产品的信息。</li>
<li><strong>获取聚合信息</strong> (<code v-pre>argInfo</code>): 获取用户的LP资产、授权额度、待领取收益等信息。</li>
<li><strong>获取用户订单</strong> (<code v-pre>getUserOrders</code>): 获取用户的当前订单和历史订单。</li>
<li><strong>空投分红奖励</strong> (<code v-pre>intoFee</code>): 管理员地址空投分红奖励。</li>
</ol>
<h4 id="安全和升级性" tabindex="-1"><a class="header-anchor" href="#安全和升级性"><span>安全和升级性：</span></a></h4>
<ul>
<li>合约继承自 <code v-pre>ManagerUpgradeable</code> 和 <code v-pre>PausableUpgradeable</code>，支持权限管理和升级功能。</li>
<li>使用 <code v-pre>SafeMath</code> 库来防止整数溢出。</li>
<li>使用 <code v-pre>SafeERC20</code> 库来安全地操作ERC20代币。</li>
</ul>
<h2 id="用户使用教程-lpfarm合约" tabindex="-1"><a class="header-anchor" href="#用户使用教程-lpfarm合约"><span>用户使用教程：LPFarm合约</span></a></h2>
<h3 id="简介" tabindex="-1"><a class="header-anchor" href="#简介"><span>简介</span></a></h3>
<p>本教程旨在指导用户如何使用LPFarm智能合约进行流动性挖矿。LPFarm合约允许用户存入YT Token来获得奖励，并且提供了一系列的功能，包括存入、领取收益和本金等。</p>
<h3 id="前提条件" tabindex="-1"><a class="header-anchor" href="#前提条件"><span>前提条件</span></a></h3>
<ul>
<li>用户需要有一个支持以太坊的数字钱包，如MetaMask、TokenPoint。</li>
<li>用户钱包中需要有足够的ETH和相应的YT Token。</li>
<li>用户需要知道如何与智能合约交互。</li>
</ul>
<h3 id="步骤1-连接钱包" tabindex="-1"><a class="header-anchor" href="#步骤1-连接钱包"><span>步骤1：连接钱包</span></a></h3>
<ol>
<li>打开您选择的数字钱包应用。</li>
<li>确保您的钱包已连接到部署LPFarm合约的以太坊网络。</li>
</ol>
<h3 id="步骤2-授权lp-token" tabindex="-1"><a class="header-anchor" href="#步骤2-授权lp-token"><span>步骤2：授权LP Token</span></a></h3>
<ol>
<li>在LPFarm合约界面上找到“授权”按钮。</li>
<li>点击“授权”，并选择您想要授权的LP Token数量。</li>
<li>确认交易，等待网络确认。</li>
</ol>
<h3 id="步骤3-查看合约信息" tabindex="-1"><a class="header-anchor" href="#步骤3-查看合约信息"><span>步骤3：查看合约信息</span></a></h3>
<ul>
<li>使用合约提供的<code v-pre>getUserInfo</code>、<code v-pre>getLpToken</code>、<code v-pre>getToken</code>等函数来查看您的LP Token余额、奖励代币地址等信息。</li>
</ul>
<h3 id="步骤4-存入lp-token" tabindex="-1"><a class="header-anchor" href="#步骤4-存入lp-token"><span>步骤4：存入LP Token</span></a></h3>
<ol>
<li>在合约界面上找到“存入”功能。</li>
<li>输入您想要存入的LP Token数量。</li>
<li>选择一个产品ID（如果有多个产品）。</li>
<li>点击“存入”并确认交易。</li>
<li>等待网络确认，并查看您的存入状态。</li>
</ol>
<h3 id="步骤5-领取收益" tabindex="-1"><a class="header-anchor" href="#步骤5-领取收益"><span>步骤5：领取收益</span></a></h3>
<ol>
<li>在合约界面上找到“领取收益”功能。</li>
<li>点击“领取收益”，合约会自动处理并发送您应得的奖励到您的钱包。</li>
<li>确认交易，等待网络确认。</li>
</ol>
<h3 id="步骤6-领取本金" tabindex="-1"><a class="header-anchor" href="#步骤6-领取本金"><span>步骤6：领取本金</span></a></h3>
<ol>
<li>在合约界面上找到“领取本金”功能。</li>
<li>输入您想要领取的订单ID。</li>
<li>点击“领取本金”并确认交易。</li>
<li>等待网络确认，并查看您的本金领取状态。</li>
</ol>
<h3 id="步骤7-查看订单和收益" tabindex="-1"><a class="header-anchor" href="#步骤7-查看订单和收益"><span>步骤7：查看订单和收益</span></a></h3>
<ul>
<li>使用<code v-pre>getUserOrders</code>函数来查看您的当前订单和历史订单。</li>
<li>使用<code v-pre>pendingToken</code>函数来查看您的待领取奖励。</li>
</ul>
<h3 id="注意事项" tabindex="-1"><a class="header-anchor" href="#注意事项"><span>注意事项</span></a></h3>
<ul>
<li>在进行任何交易之前，请确保您了解交易的详情和可能的费用。</li>
<li>领取收益和本金之前，请确保合约有足够的奖励代币供应。</li>
<li>如果合约被暂停，某些操作可能会受到限制。</li>
</ul>
<h3 id="常见问题" tabindex="-1"><a class="header-anchor" href="#常见问题"><span>常见问题</span></a></h3>
<p><strong>Q: 我如何知道我的授权额度？</strong>
A: 您可以使用<code v-pre>argInfo</code>函数查看您的授权额度。</p>
<p><strong>Q: 我可以同时存入多个产品吗？</strong>
A: 是的，您可以存入多个产品。</p>
<p><strong>Q: 我可以随时领取我的本金吗？</strong>
A: 这取决于产品的具体规则，您可以在产品锁定期结束之后领取您的本金。</p>
<p><strong>Q: 如果我有其他问题怎么办？</strong>
A: 您可以联系合约的管理员或查看合约的官方文档获取更多帮助。</p>
<p>请在使用合约前仔细阅读本教程，并确保您理解了所有的步骤和注意事项。智能合约交互涉及到您的资产安全，请谨慎操作。</p>
